con:config.script:
import jxl.*

def fi = new File("C:\\SoupUI_18Dec2018\\TestData.xls");
def wk = Workbook.getWorkbook(fi);
def st = wk.getSheet(0);
def rows = st.getRows();

def cont = 0;
def outfile = new File ("C://SoupUI_18Dec2018//"+"test4.txt")
for(def i=0; i<rows; i++)
{

def e1 = st.getCell(0,i).getContents();
def e2 = st.getCell(1,i).getContents();

def util = new com.eviware.soapui.support.GroovyUtils(context);

def reqxml = util.getXmlHolder("Add#Request");

context.testCase.getTestStepByName("Prop").setPropertyValue("A",e1);
context.testCase.getTestStepByName("Prop").setPropertyValue("B",e2);
//reqxml.setNodeValue("//tem:Add/tem:intA", e1);
//reqxml.setNodeValue("//tem:Add/tem:intB", e2);

reqxml.updateProperty();

testRunner.runTestStepByName("Add");

def resxml = util.getXmlHolder("Add#Response");
def val = resxml.getNodeValue("//ns1:AddResponse/ns1:AddResult");

if(cont==0)
{
	outfile.write(val)

}
else
{
	outfile.append(System.getProperty("line.separator") + val)
}
cont++
}
